import React from 'react';
import axios from 'axios';

const FacebookLoginComponent = () => {
  const handleFacebookLogin = async () => {
    try {
      // Gọi API Facebook để xác thực và nhận thông tin người dùng
      const response = await axios.get(
        `https://graph.facebook.com/v12.0/me?fields=id,name,email&access_token=YOUR_ACCESS_TOKEN`
      );

      // In thông tin người dùng từ Facebook
      console.log('User Info:', response.data);
    } catch (error) {
      console.error('Error during Facebook login:', error);
    }
  };

  return (
    <div>
      <button onClick={handleFacebookLogin}>Đăng nhập Facebook</button>
    </div>
  );
};

export default FacebookLoginComponent;
